import React, { Component } from "react";
import Projectors from "./Projectors";

class Tv extends Component {
  render() {
    return (
      <div>
        <h3
          style={{
            textAlign: `center`,
            backgroundColor: `orangered`,
            color: `white`,
            padding: `20px`,
          }}
        >
          Tvs & Projectors
        </h3>
        <div className="box">
          <Projectors />
        </div>
      </div>
    );
  }
}

export default Tv;
